■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>洗練された品揃えのカタログギフト★</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5336/1022646-01.jpg" width="600" height="734"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【のし・ラッピング対応について】<br>のし・ラッピングをご希望の場合はお受けいたします。<br>ご希望の方はご注文時に、お申しつけください。<br>※間違い防止の為、用途・名前などは明確な記載をお願いします。<br> <br>【使用期限について】<br>カタログお届け日から約6ヶ月間をお申込みハガキの有効期限とさせていただきます。<br><br>【システム料について】<br>システム料(税抜600円)は販売価格に含まれております。<br>※システム料には商品(お届け先様がご注文されるお品物)を個別にお届けする宅配料の他、お申し込みハガキ用切手代も含まれております。</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="600" height="367" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5336/1022646-02.jpg"><br><font size="3"></font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="367" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5336/1022646-03.jpg"><br><font size="3"></font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="367" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5336/1022646-04.jpg"><br><font size="3"></font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="367" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5336/1022646-05.jpg"><br><font size="3">※カタログ掲載内容のイメージです。</font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">ブランドやファッション雑貨、キッチン、インテリア、防災グッズ、キッズアイテムからグルメまで、洗練された商品を1冊にまとめた、多彩なラインナップで贈り先様に楽しんでいただけるカタログギフトです。結婚引き出物、内祝い、出産内祝い、快気祝い、新築祝いなど、様々なシーンにご利用いただけます。落ち着いた上品なイメージで、用途や年代を問わず贈りやすい表紙デザインも魅力です♪</font></td></tr></table><br><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6--><br>【必ずご確認ください】<br>※この商品はメーカーより直送のため、他の商品との同梱はできません<br> ※離島の場合、別途中継料がかかります。<br>※代引でのお支払いはお受けできません。 <br>※お届け先が沖縄・北海道・離島の場合、通常納期より3～6日ほど日数が掛かる場合がございます。■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">ブランドやファッション雑貨、キッチン、インテリア、防災グッズ、キッズアイテムからグルメまで、洗練された商品を1冊にまとめた、多彩なラインナップで贈り先様に楽しんでいただけるカタログギフトです。結婚引き出物、内祝い、出産内祝い、快気祝い、新築祝いなど、様々なシーンにご利用いただけます。落ち着いた上品なイメージで、用途や年代を問わず贈りやすい表紙デザインも魅力です♪</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">箱サイズ:27×22×3cm</font><br><font color="#333333" size="-1">個装サイズ：27×22×3cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：555g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">ページ数:332ページ<br>商品掲載点数:服飾・生活雑貨/約1640点、グルメ/約120点<br>専用パッケージ(化粧箱)付き</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6--><br>【必ずご確認ください】<br>※この商品はメーカーより直送のため、他の商品との同梱はできません<br> ※離島の場合、別途中継料がかかります。<br>※代引でのお支払いはお受けできません。 <br>※お届け先が沖縄・北海道・離島の場合